'使用方法（用法）:1、皮肤伤口（外伤、术创等）、溃疡面等，直接使用本品，抗感染，促进愈合；2、细菌（含耐药菌株）、部分真菌感染引起的宠物皮肤病、外耳炎等，配合使用本品可抗感染；3、其他感染性疾病（脓皮症、口角炎等）的支持治疗，广谱高效杀菌；用法用量：1、细菌、真菌感染引起的犬、猫皮肤病：均匀喷于患处，以充分湿润患处为宜，2-3次/天，或遵医嘱。2、犬、猫外耳炎：喷在耳内，然后用手捂住耳朵，轻柔数次后松开，使液体均匀分布于耳道，2-3次/日，1-2喷/次，或遵医嘱。3、犬、猫口腔溃疡：喷于溃疡处，4-5次/天，1-2喷/次。4、犬、猫皮肤刮伤、擦伤等创面的杀菌消炎：先用0.9%的无菌生理盐水将创面洗净，然后喷于创面，2-3次/天，或遵医嘱。5、手术后伤口表面的护理：喷于伤口表面，2-3次/天，或遵医嘱。', NULL,
'产品特点：1、基因工程溶菌酶，广谱杀菌；2、天然相容性，无刺激性、无毒性；3、抗菌活性稳定，无耐药性', '院长', 0.00 , '院长', NULL , 0,'34ff5c2e-6625-4d6d-ad39-d1745755b3a8','34ff5c2e-6625-4d6d-ad39-d1745755b3a8');
